    n, m = map(int, input().split())
    graph = [[] for i in range(n)]
    for i in range(m):
        u, v = map(int, input().split())
        graph[u-1].append(v-1)
        graph[v-1].append(u-1)
    # print(graph)
    def dfs(graph, visited, v, ans):
        visited[v] = True
        for i in graph[v]:
            if not visited[i]:
                dfs(graph, visited, i, ans)
        ans.append(v)
    def dfs2(graph, visited, v, ans):
        visited[v] = True
        for i in graph[v]:
            if not visited[i]:
                dfs2(graph, visited, i, ans)
    visited = [False] * n
    ans = []
    for i in range(n):
        if not visited[i]:
            dfs(graph, visited, i, ans)
    visited = [False] * n
    ans2 = []
    for i in range(n-1, -1, -1):
        if not visited[ans[i]]:
            dfs2(graph, visited, ans[i], ans2)
    if len(ans2) == n:
        print(len(ans2))
        print(*[i+1 for i in ans2])
    else:
        print(-1)

